        "R": 4,
        "Name": "Pseudoaleta de dragn de las profundidades",
        "Desc": "Una parte del cuerpo del Dragarto de las Profundidades recogida tras derrotarlo.<br>Aunque parece una aleta, en realidad no sirve para nada.<br>Los antiguos habitantes del reino de Byakuya estudiaron en profundidad a los Dragartos de las Profundidades, cuya mayor particularidad es que pueden decidir qu caractersticas conservar y transmitir a sus cras segn ellos mismos deseen. Como detestan la luz artificial, estos Dragartos pierden una gran parte de su sentido de la vista durante la adultez. Adems, para poder luchar, han evolucionado hasta ser capaces de cambiar de elemento.",
